  PRIMARY KEY (`studmem_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `tbl_studentmembership` */

/*Table structure for table `tbl_studentpackages` */

DROP TABLE IF EXISTS `tbl_studentpackages`;

CREATE TABLE `tbl_studentpackages` (
  `studpack_id` int(11) NOT NULL AUTO_INCREMENT,
  `student_id` int(11) DEFAULT 0,
  `invoice_id` int(11) DEFAULT 0,
  `package_id` int(11) DEFAULT 0,
  `details` text DEFAULT NULL,
  `date_added` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`studpack_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `tbl_studentpackages` */

/*Table structure for table `tbl_studentpromotions` */

DROP TABLE IF EXISTS `tbl_studentpromotions`;

CREATE TABLE `tbl_studentpromotions` (
  `promotion_id` int(11) NOT NULL AUTO_INCREMENT,
  `student_id` int(11) DEFAULT NULL,
  `rank_id` int(11) DEFAULT NULL,
  `ses_attended` int(11) DEFAULT NULL,
  `next_rank` text DEFAULT NULL,
  `photo` blob DEFAULT NULL,
  `remarks` varchar(255) DEFAULT NULL,
  `eval_technique` text DEFAULT NULL,
  `eval_attitude` text DEFAULT NULL,
  `eval_remarks` text DEFAULT NULL,
  `date_promoted` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`promotion_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `tbl_studentpromotions` */

/*Table structure for table `tbl_students` */

DROP TABLE IF EXISTS `tbl_students`;

CREATE TABLE `tbl_students` (
  `student_id` int(11) NOT NULL AUTO_INCREMENT,
  `reference_id` varchar(255) NOT NULL DEFAULT '',
  `lastname` varchar(255) NOT NULL DEFAULT '',
  `firstname` varchar(255) NOT NULL DEFAULT '',
  `middlename` varchar(255) DEFAULT '',
  `extname` varchar(255) DEFAULT '',
  `nickname` varchar(255) DEFAULT '',
  `address` text DEFAULT NULL,
  `mobileno` varchar(255) DEFAULT NULL,
  `telephoneno` varchar(255) DEFAULT NULL,
  `emailadd` varchar(255) DEFAULT NULL,
  `birthdate` date NOT NULL,
  `religion` varchar(22) DEFAULT NULL,
  `sex` varchar(50) DEFAULT '',
  `height` int(50) DEFAULT NULL,
  `weight` int(50) DEFAULT NULL,
  `school` text DEFAULT NULL,
  `company` text DEFAULT NULL,
  `fatherinfo` text DEFAULT NULL,
  `motherinfo` text DEFAULT NULL,
  `guardianinfo` text DEFAULT NULL,
  `emergencyinfo` text DEFAULT NULL,
  `healthproblems` text DEFAULT NULL,
  `previoustrainings` text DEFAULT NULL,
  `archived` int(5) NOT NULL DEFAULT 0,
  `status` int(5) DEFAULT 0,
  `photo` blob DEFAULT NULL,
  `registration_date` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`student_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `tbl_students` */

/*Table structure for table `tbl_userlogs` */

DROP TABLE IF EXISTS `tbl_userlogs`;

CREATE TABLE `tbl_userlogs` (
